              "content": "First of all it's a masterpiece, it's shows how the higher class actually judge the lower class people. At it looks like a normal story of a family who all are struggling hard to live, but their life gets changed when all four of them one by one get employed in park's house. After sometime we also got to see the frustration and anger of Kim family on park family because they were judged by them.their were no unnecessarily plot twist in the film which led the film very smoothly. All over it's a must watch film.",
