              "author_details": {
                  "name": "",
                  "username": "tylero",
                  "avatar_path": nil,
                  "rating": 10.0
              },
              "content": "What starts as a seemingly simple premise quickly unfolds into much more. I didn't expect an enhanced perspective into my own life, but that's just what happened. Parasite is a timely analysis of the ever-increasing divide between rich and poor, all while being witty enough to make for an exhilarating ride.",
