                  "username": "RustyBoi",
                  "avatar_path": nil,
                  "rating": 10.0
              },
              "content": "One of the funniest and most disturbing films I've ever seen. Probably some of the best cinematography ever. 10/10",
              "created_at": "2020-08-21T16:51:25.394Z",
              "id": "5f3ffb8d19ab5900371d852c",
