              "author": "r96sk",
              "author_details": {
                  "name": "",
                  "username": "r96sk",
                  "avatar_path": "/https://secure.gravatar.com/avatar/96c2e0e4ac98450f9e8e3c0a0a40aad8.jpg",
                  "rating": 9.0
              },
              "content": "Despite hearing about this from day dot, I thankfully managed to avoid knowing anything about this other than it's title, director and subsequent success. Boy am I glad, because it's quite the ride!\r\n\r\nNo doubt about it, <em>'Parasite'</em> is a high quality film. It wasn't at all what I had assumed it would be like, it has a much more comedic side to it than I was expecting - and that's a positive. Yet, it's still pretty dark. It's a great mix. The plot is one that is very entertaining to see play out - the ending is particularly nuts.\r\n\r\nThe cast do a fantastic job, especially the main quartet. Song Kang-ho would be my personal standout, I enjoyed watching him throughout. Choi Woo-shik is very good too, as are Park So-dam and Jang Hye-jin. All of the onscreen talent do terrific though, from Cho Yeo-jeong to Lee Jung-eun.\r\n\r\nI don't have any negatives for this, it's a brilliant film. From the cinematography, to the dialogue, to the locations, to the humour. You name it, this produces it on an impressive level.\r\n\r\nNot that I need to say this, given I'm seemingly one of the last few who hadn't, but you must watch this!",
              "created_at": "2020-11-01T01:40:56.693Z",
              "id": "5f9e122853866e0039ea1cf1",
              "updated_at": "2020-11-01T14:55:05.965Z",
              "url": "https://www.themoviedb.org/review/5f9e122853866e0039ea1cf1"
          },
          {
              "author": "Mark B",
              "author_details": {
                  "name": "Mark B",
                  "username": "repojack",
                  "avatar_path": "/3bGlq0gaf6dK3qFYTWcmrimxbbt.jpg",
                  "rating": 10.0
              },
              "content": "<i>Parasite</i> is fantastic. \r\n\r\nIt's clever. It's funny. It's disturbing. And yes, there is a powerful underlying theme of the divide between rich and poor. But the latter is so deftly weaved into the fabric of the story, you really don't think about it much until a fateful scene before the last act. \r\n\r\nIt fully deserved the Oscar for Best Picture and Director. If only for the peach fuzz fight scene.",
